import request from '@icccdPath/utils/request';
import { getSetting } from '@icccdPath/utils/request';
let QZ_BKSQ = getSetting('QZ_BKSQ');
let api = {
  /**
   * @description: 获取布控范围
   * @param {*} bkfwlx
   */
  getBkfw(bkfwlx) {
    return request.get(`/v1/bkfw${bkfwlx ? '/' + bkfwlx : ''}`, {
      baseURL: QZ_BKSQ
    });
  }
};
export default api;
